import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import { HomePage, CounterButtonPage, PeopleListPage } from './pages'
function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/" exact>
            <HomePage />
          </Route>
          <Route path="/counter" exact>
            <CounterButtonPage />
          </Route>
          <Route path="/people-list" exact>
            <PeopleListPage />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
